import React, { useRef } from 'react';
import html2canvas from 'html2canvas';
import jsPDF from 'jspdf';

const Results = ({ answers, shuffledQuestions, onRetake }) => {
  const reportRef = useRef();

  // Categories matching the questions
  const categories = [
    'Cognitive Flexibility',
    'Metacognition', 
    'Working Memory',
    'Organization',
    'Emotional Regulation',
    'Inhibitory & Impulse Control',  
    'Task Initiation & Motivation',
    'Sustained Attention',
    'Time Management'
  ];

  // Calculate scores for each category using shuffled questions
  const calculateScores = () => {
    const scores = {};

    // Initialize scores for each category
    categories.forEach(category => {
      scores[category] = {
        answers: [],
        raw: 0,
        percentage: 50,
        questionsAnswered: 0
      };
    });

    // Debug logging
    console.log('=== SCORING DEBUG ===');
    console.log('Shuffled Questions Order:', shuffledQuestions.map(q => ({ id: q.id, category: q.category, text: q.text.substring(0, 50) + '...' })));
    console.log('Answers Array:', answers);

    // Group answers by category based on shuffled questions
    shuffledQuestions.forEach((question, index) => {
      if (answers[index] !== undefined) {
        const categoryName = question.category;
        const answerValue = answers[index];

        console.log(`Question ${index + 1}: "${question.text.substring(0, 30)}..." ‚Üí Category: ${categoryName} ‚Üí Answer: ${answerValue}`);

        if (scores[categoryName]) {
          scores[categoryName].answers.push(answerValue);
        }
      }
    });

    // Calculate final scores for each category
    Object.keys(scores).forEach(category => {
      const categoryAnswers = scores[category].answers;
      const rawScore = categoryAnswers.reduce((sum, answer) => sum + answer, 0);
      const percentage = Math.round(((rawScore + (categoryAnswers.length * 3)) / (categoryAnswers.length * 6)) * 100);

      console.log(`${category}: Answers [${categoryAnswers.join(', ')}] ‚Üí Raw: ${rawScore} ‚Üí Percentage: ${percentage}%`);

      scores[category] = {
        raw: rawScore,
        percentage: percentage,
        questionsAnswered: categoryAnswers.length
      };
    });

    console.log('Final Scores:', scores);
    console.log('=== END DEBUG ===');

    return scores;
  };

  const scores = calculateScores();

  // Get color category based on percentage
  const getColorCategory = (percentage) => {
    if (percentage > 60) return 'excellent';
    if (percentage >= 40) return 'good';
    return 'needs-improvement';
  };

  // Get interpretation text for scores
  const getScoreInterpretation = (percentage) => {
    if (percentage >= 80) return { level: 'Excellent', description: 'Strong functioning - this is a real strength for you!' };
    if (percentage >= 65) return { level: 'Good', description: 'Solid functioning with room for continued growth.' };
    if (percentage >= 40) return { level: 'Developing', description: 'Average functioning - focus area for skill building.' };
    if (percentage >= 25) return { level: 'Emerging', description: 'Area that would benefit from targeted strategies and support.' };
    return { level: 'Growing', description: 'Significant growth opportunity - consider seeking additional resources.' };
  };

  // Download report function
  const downloadReport = async () => {
    const element = reportRef.current;
    const canvas = await html2canvas(element, {
      scale: 2,
      useCORS: true,
      allowTaint: true,
      backgroundColor: '#f5f3f0'
    });

    const imgData = canvas.toDataURL('image/png');
    const pdf = new jsPDF('p', 'mm', 'a4');
    const imgWidth = 210;
    const pageHeight = 295;
    const imgHeight = (canvas.height * imgWidth) / canvas.width;
    let heightLeft = imgHeight;

    let position = 0;

    pdf.addImage(imgData, 'PNG', 0, position, imgWidth, imgHeight);
    heightLeft -= pageHeight;

    while (heightLeft >= 0) {
      position = heightLeft - imgHeight;
      pdf.addPage();
      pdf.addImage(imgData, 'PNG', 0, position, imgWidth, imgHeight);
      heightLeft -= pageHeight;
    }

    pdf.save('neurish-executive-functioning-report.pdf');
  };

  // Enhanced radar chart using SVG with scale labels
  const RadarChart = ({ scores }) => {
    const size = 400;
    const center = size / 2;
    const radius = size / 2 - 60;
    const categories = Object.keys(scores);
    const values = Object.values(scores).map(s => s.percentage);

    const angleStep = (2 * Math.PI) / categories.length;

    // Generate points for the data polygon
    const dataPoints = values.map((value, index) => {
      const angle = index * angleStep - Math.PI / 2; // Start from top
      const r = (value / 100) * radius;
      const x = center + r * Math.cos(angle);
      const y = center + r * Math.sin(angle);
      return `${x},${y}`;
    }).join(' ');

    // Generate points for the outer polygon (scale lines)
    const outerPoints = categories.map((_, index) => {
      const angle = index * angleStep - Math.PI / 2;
      const x = center + radius * Math.cos(angle);
      const y = center + radius * Math.sin(angle);
      return { x, y, angle, category: categories[index] };
    });

    // Scale levels and their labels - evenly spaced from -18 to +18
    const scaleRings = [
      { scale: 0.2, label: '-18' },
      { scale: 0.4, label: '-9' },
      { scale: 0.6, label: '0' },
      { scale: 0.8, label: '+9' },
      { scale: 1.0, label: '+18' }
    ];

    return (
      <div className="radar-chart-container">
        <svg width={size} height={size} style={{ overflow: 'visible' }}>
          {/* Background grid circles with labels */}
          {scaleRings.map(({ scale, label }) => (
            <g key={scale}>
              <circle
                cx={center}
                cy={center}
                r={radius * scale}
                fill="none"
                stroke="#e5e7eb"
                strokeWidth="1"
              />
              <text
                x={center}
                y={center - radius * scale - 5}
                textAnchor="middle"
                fontSize="10"
                fill="#9ca3af"
                fontWeight="500"
              >
                {label}
              </text>
            </g>
          ))}

          {/* Grid lines from center to each point */}
          {outerPoints.map((point, index) => (
            <line
              key={index}
              x1={center}
              y1={center}
              x2={point.x}
              y2={point.y}
              stroke="#e5e7eb"
              strokeWidth="1"
            />
          ))}

          {/* Data polygon */}
          <polygon
            points={dataPoints}
            fill="rgba(53, 92, 125, 0.2)"
            stroke="#355c7d"
            strokeWidth="3"
          />

          {/* Data points */}
          {values.map((value, index) => {
            const angle = index * angleStep - Math.PI / 2;
            const r = (value / 100) * radius;
            const x = center + r * Math.cos(angle);
            const y = center + r * Math.sin(angle);
            return (
              <circle
                key={index}
                cx={x}
                cy={y}
                r="5"
                fill="#355c7d"
                stroke="white"
                strokeWidth="2"
              />
            );
          })}

          {/* Category labels */}
          {outerPoints.map((point, index) => {
            // Position labels outside the chart
            const labelDistance = radius + 35;
            const labelX = center + labelDistance * Math.cos(point.angle);
            const labelY = center + labelDistance * Math.sin(point.angle);

            return (
              <text
                key={index}
                x={labelX}
                y={labelY}
                textAnchor="middle"
                dominantBaseline="middle"
                fontSize="13"
                fill="#4b5563"
                style={{ fontWeight: '500' }}
                transform={`rotate(0 ${labelX} ${labelY})`}
              >
                <tspan x={labelX} dy="0">{point.category.split(' ')[0]}</tspan>
                {point.category.split(' ').length > 1 && (
                  <tspan x={labelX} dy="15">{point.category.split(' ').slice(1).join(' ')}</tspan>
                )}
              </text>
            );
          })}
        </svg>
      </div>
    );
  };

  return (
    <div className="container">
      <div className="card results-container" ref={reportRef}>
        <div style={{ textAlign: 'center', marginBottom: '40px' }}>
          <h2>Your Neurish Profile</h2>
          <p style={{ fontSize: '24px', color: '#6b7280', marginBottom: '20px' }}>
            Find. Focus. Flourish.
          </p>
          <p style={{ fontSize: '14px', color: '#9ca3af' }}>
            Generated on {new Date().toLocaleDateString()} | neurish.app
          </p>
        </div>

        <div style={{ 
          background: '#f9fafb', 
          padding: '30px', 
          borderRadius: '12px',
          border: '1px solid #f3f4f6',
          marginBottom: '40px'
        }}>
          <h3 style={{ marginBottom: '20px', color: '#1f2937', fontSize: '20px', fontWeight: '500', textAlign: 'center' }}>
            Understanding Your Executive Functioning Profile
          </h3>
          <p style={{ lineHeight: '1.7', color: '#4b5563', marginBottom: '20px', textAlign: 'center' }}>
            Executive functioning skills are the mental processes that help us plan, focus, remember instructions, and manage multiple tasks successfully. 
            Your profile shows your current strengths and areas for growth across nine key domains.
          </p>
          <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', gap: '20px', marginTop: '30px' }}>
            <div style={{ textAlign: 'center' }}>
              <div style={{ 
                width: '20px', 
                height: '20px', 
                backgroundColor: '#10b981', 
                borderRadius: '4px', 
                margin: '0 auto 8px' 
              }}></div>
              <div style={{ fontWeight: '500', color: '#1f2937' }}>Excellent (60%+)</div>
              <div style={{ fontSize: '14px', color: '#6b7280' }}>Strong functioning</div>
            </div>
            <div style={{ textAlign: 'center' }}>
              <div style={{ 
                width: '20px', 
                height: '20px', 
                backgroundColor: '#f59e0b', 
                borderRadius: '4px', 
                margin: '0 auto 8px' 
              }}></div>
              <div style={{ fontWeight: '500', color: '#1f2937' }}>Good (40-60%)</div>
              <div style={{ fontSize: '14px', color: '#6b7280' }}>Solid with growth potential</div>
            </div>
            <div style={{ textAlign: 'center' }}>
              <div style={{ 
                width: '20px', 
                height: '20px', 
                backgroundColor: '#ef4444', 
                borderRadius: '4px', 
                margin: '0 auto 8px' 
              }}></div>
              <div style={{ fontWeight: '500', color: '#1f2937' }}>Growing (Below 40%)</div>
              <div style={{ fontSize: '14px', color: '#6b7280' }}>Focus area for development</div>
            </div>
          </div>
        </div>

        <RadarChart scores={scores} />

        <div className="category-scores">
          {Object.entries(scores).map(([category, data]) => {
            const interpretation = getScoreInterpretation(data.percentage);
            return (
              <div 
                key={category} 
                className={`category-card ${getColorCategory(data.percentage)}`}
              >
                <h3>{category}</h3>
                <div className="score">{data.percentage}%</div>
                <div style={{ fontSize: '14px', fontWeight: '500', color: '#374151', marginBottom: '8px' }}>
                  {interpretation.level}
                </div>
                <div style={{ fontSize: '12px', color: '#6b7280', lineHeight: '1.4' }}>
                  {interpretation.description}
                </div>
                <div className="raw-score" style={{ marginTop: '8px' }}>
                  Raw Score: {data.raw > 0 ? '+' : ''}{data.raw}/{data.questionsAnswered * 3}
                  {data.questionsAnswered < 6 && (
                    <span style={{ display: 'block', fontSize: '12px', color: '#ef4444', marginTop: '4px' }}>
                      ({data.questionsAnswered}/6 questions answered)
                    </span>
                  )}
                </div>
              </div>
            );
          })}
        </div>

        <div style={{ 
          marginTop: '50px', 
          padding: '30px', 
          backgroundColor: '#f0fdf4', 
          borderRadius: '12px',
          border: '1px solid #dcfce7'
        }}>
          <h3 style={{ marginBottom: '20px', color: '#166534', fontSize: '20px', fontWeight: '500' }}>
            üí° What Your Results Mean & Next Steps
          </h3>
          <div style={{ display: 'grid', gridTemplateColumns: '1fr', gap: '20px', lineHeight: '1.6' }}>
            <div>
              <h4 style={{ color: '#166534', marginBottom: '10px', fontSize: '16px' }}>üéØ Your Strengths</h4>
              <p style={{ color: '#15803d', fontSize: '14px' }}>
                Areas scoring 60%+ are your cognitive superpowers! These are skills you can rely on and leverage in challenging situations.
              </p>
            </div>
            <div>
              <h4 style={{ color: '#166534', marginBottom: '10px', fontSize: '16px' }}>üìà Growth Opportunities</h4>
              <p style={{ color: '#15803d', fontSize: '14px' }}>
                Areas below 60% represent exciting opportunities for development. Small improvements here can have big impacts on daily life.
              </p>
            </div>
            <div>
              <h4 style={{ color: '#166534', marginBottom: '10px', fontSize: '16px' }}>üõ†Ô∏è Practical Tips</h4>
              <ul style={{ color: '#15803d', fontSize: '14px', paddingLeft: '20px' }}>
                <li>Use your strengths to support areas for growth</li>
                <li>Start with small, specific strategies in lower-scoring areas</li>
                <li>Track progress over time - executive functioning can improve!</li>
                <li>Consider sharing results with a coach, therapist, or trusted friend</li>
              </ul>
            </div>
          </div>
        </div>

        <p style={{ marginTop: '40px', fontSize: '16px', color: '#6b7280', lineHeight: '1.6', textAlign: 'center' }}>
          <strong>Remember:</strong> This assessment reflects your self-perception of current functioning. 
          Executive functioning skills can be developed and improved with practice, strategies, and support. 
          Your brain is neuroplastic - it can change and grow throughout your life!
        </p>

        <div style={{ display: 'flex', gap: '20px', justifyContent: 'center', marginTop: '40px' }}>
          <button 
            className="btn btn-primary" 
            onClick={downloadReport}
            style={{ backgroundColor: '#10b981', display: 'flex', alignItems: 'center', gap: '8px' }}
          >
            üìÑ Download Report
          </button>
          <button 
            className="btn btn-secondary" 
            onClick={onRetake}
          >
            üîÑ Retake Assessment
          </button>
        </div>
      </div>
    </div>
  );
};

export default Results;
